window.bookSummaryJSON = "<p>A sexy-as-sin grumpy vampire hiding from the world . . . a cursed woman who can hear colors . . . and a demigod determined to take over Instagram.</p> <p>When Finch Dante settles in Ravenfall, the last thing he expects is to find himself on Axegate Walk, a boardwalk of Otherworldian vendors. Keeping his head down and his secrets tight was all Finch wanted . . . but fate had other ideas in the form of a bubbly, quirky woman with a penchant for the weird, and an uncanny ability to know what he was feeling.</p> <p>Tatiana Romanoff might sell haunted dolls, but she doesn't believe in the paranormal . . . until she realizes the town council has cursed her romantic endeavors. So when the mysterious and incredibly handsome Finch strolls into her life, she is determined to keep him at arm's length lest he be blighted by her curse.</p> <p>Once a body is discovered, it's up to Tatiana and Finch to overcome their own emotional wounds to untangle the mystery surrounding them . . . one that risks their life together if they want to save humankind from destruction.</p> <p>Contains mature themes.</p>"; 
